  `POINTS_REQUIRED` int(10) unsigned DEFAULT NULL,
  `SKILLS_REQUIRED_COUNT` int(10) unsigned DEFAULT NULL,
  `SKILLS_REQUIRED` varchar(201) DEFAULT NULL,
  `PRECLUSION_SKILLS` varchar(50) DEFAULT NULL,
  `XP_TYPE` varchar(40) DEFAULT NULL,
  `XP_COST` int(10) unsigned DEFAULT NULL,
  `XP_CAP` int(10) unsigned DEFAULT NULL,
  `MISSIONS_REQUIRED` varchar(1) DEFAULT NULL,
  `APPRENTICESHIPS_REQUIRED` int(10) unsigned DEFAULT NULL,
  `STATS_REQUIRED` varchar(1) DEFAULT NULL,
  `SPECIES_REQUIRED` varchar(56) DEFAULT NULL,
  `JEDI_STATE_REQUIRED` varchar(16) DEFAULT NULL,
  `SKILL_ABILITY` varchar(1) DEFAULT NULL,
  `COMMANDS` text,
  `SKILL_MODS` text,
  `SCHEMATICS_GRANTED` varchar(123) DEFAULT NULL,
  `SCHEMATICS_REVOKED` varchar(1) DEFAULT NULL,
  `SEARCHABLE` tinyint(1) DEFAULT NULL,
